import React, {useState} from "react";
import {Container, Row, Col} from "reactstrap";
//Import Breadcrumb
import Breadcrumbs from "../../components/Common/Breadcrumb";

const Camera = () => {
	return (
		<div>
			<div className="page-content">
				<Container fluid>
					<h1>Vista de Camara</h1>
				</Container>
			</div>
		</div>
	);
};

export default Camera;
